import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import {Home} from './pages/Home/';

import {VisualizarCliente} from './pages/Cliente/VisualizarCliente';
import {EditarClienteId} from './pages/Cliente/EditarClienteId';
import {ExcluirClienteId} from './pages/Cliente/ExcluirClienteId';

import {VisualizarPedido} from './pages/Pedido/VisualizarPedido';
import {EditarPedidoId} from './pages/Pedido/EditarPedidoId';
import {ExcluirPedidoId} from './pages/Pedido/ExcluirPedidoId';

import {VisualizarServico} from './pages/Servico/VisualizarServico';
import {EditarServicoId} from './pages/Servico/EditarServicoId';
import {ExcluirServicoId} from './pages/Servico/ExcluirServicoId';


function App() {
  return (
    <div>
      <Router>
        <Switch>
        <Route exact path="/" component={Home}/>  

        <Route path="/visualizarcliente" component={VisualizarCliente}/>
        <Route path="/editarclienteid" component={EditarClienteId}/>
        <Route path="/excluirclienteid" component={ExcluirClienteId}/>


        <Route path="/visualizarpedido" component={VisualizarPedido}/>
        <Route path="/editarpedidoid" component={EditarPedidoId}/>
        <Route path="/excluirpedidoid" component={ExcluirPedidoId}/>


        <Route path="/visualizarservico" component={VisualizarServico}/>
        </Switch>  
      </Router> 
    </div>
  );
}

export default App;
